import React, { Component } from 'react';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';
import Home from '../Home/Home';
import Header from '../Elements/Header/Header'
import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <Header />
        <Route/>
      </Router>
    );
  }
}

export default App;
